const AddNewExpense = () => {
  const openNewExpenseHandler = (props) => {
    props.onAddClicked(true);
  };
  return (
    <div>
      <button onClick={openNewExpenseHandler}>Add New Expense</button>
    </div>
  );
};

export default AddNewExpense;
